import React, { Component } from 'react';
import Buttons from './Buttons.js';
import './App.css';

class App extends Component {
  render() {

    return (
      <div className="App">
        <div className='main'>
          <Buttons />
          <MainInfo />
        </div>
      </div>
    );
  }
}

class MainInfo extends Component{


  render() {
    return(
      <div>
        <article className='home-div'>
          <h1>Name Lastname</h1>
          Landing page
        </article>
        <article className='about-div'>
          <h1>About</h1>
          Basic information
        </article>
        <article className='about-div'>
          <h1>Projects</h1>
          Github links
        </article>
      </div>
    )
  }
}


export default App;
